                name:'String Puppet',
                detail:'Character controled by a hand'  
             },
             {
                id:2,
                img:'/images/2.png',
                name:'pill',
                detail:'Medicine in the hands of a man'  
             },
             {
                img:'/images/3.png',
                name:'One more',
                detail:'Man signaling for one more drink'  
             },
             {
                img:'/images/4.png',
                name:'Alien',

             },
             {
                img:'/images/5.png',
                name:'Pirate',
                detail:'Pirate with parrot on shoulder'  
             }



        ]
        return(
            <div className='row'>
                <Information/>
            </div>
        )
    }
}
export default Artist;
